// src/pages/ExamenList.js

import React, { useEffect, useState } from 'react';
import ExamenCard from '../components/ExamenCard';
import { getExamenes } from '../services/examenService';
import './ExamenList.css';

const ExamenList = () => {
  const [examenes, setExamenes] = useState([]);

  useEffect(() => {
    const fetchExamenes = async () => {
      const data = await getExamenes();
      setExamenes(data);
    };
    fetchExamenes();
  }, []);

  return (
    <div className="examen-list">
      <h2>Lista de Ex√°menes</h2>
      {examenes.map((examen) => (
        <ExamenCard key={examen.id} examen={examen} />
      ))}
    </div>
  );
};

export default ExamenList;
